import React from 'react';
import {Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar/Navbar';
import Home from './pages/home/home';

const App = () => {
  return (
    <Routes>
      <div>
        <Navbar />
        <Route path="/" element={<Home/>} />
      </div>
    </Routes>
  );
};

export default App;
